package com.vueblog.entity;import java.io.Serializable;/* * 版    权:  operate Copyright 2014-2016,All rights reserved * 文 件 名:  OrderBean.java * 描       述:  唯一编号 * 作者:  xiangmiao * 时间:  2020-07-11 11:24:27 星期六 */public class OrderBean implements Serializable{	private static final long serialVersionUID = -620485149077165320L;	/**	 * 主键	 */	private Long id;		/**	*订单编号	*/	private String orderNo;	/**	*用户ID	*/	private Long userId;	/**	*商品ID	*/	private Long goodsId;	/**	*创建时间	*/	private Long createTime;	/**	*更新时间	*/	private Long updateTime;	/**	*是否删除 0：未删除；1：已删除	*/	private int isDeleted;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getOrderNo() {		return orderNo;	}	public void setOrderNo(String orderNo) {		this.orderNo = orderNo;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Long getGoodsId() {		return goodsId;	}	public void setGoodsId(Long goodsId) {		this.goodsId = goodsId;	}	public Long getCreateTime() {		return createTime;	}	public void setCreateTime(Long createTime) {		this.createTime = createTime;	}	public Long getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Long updateTime) {		this.updateTime = updateTime;	}	public int getIsDeleted() {		return isDeleted;	}	public void setIsDeleted(int isDeleted) {		this.isDeleted = isDeleted;	}}